// import HS from "./HS";
import Navbar from "../components/Layout/Navbar";
import ImageSlider from "../components/Layout/ImageSlider";
function Homepage() {
  return (
    <>
      <Navbar />
      <hero
        pname="hero-mid"
        herpimg="https://images.unsplash.com/photo-1540575467063-178a50c2df87?q=80&w=1740&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
        title="About"
        text="Choose your place "
        btnClass="hide"
      />
    </>
  );
}
export default Homepage;
